version: 2
name: file-test4
description: Add Hello World to READMEs

# Find README files in the specified repository
on:
  - repositoriesMatchingQuery: repo:^github\.com/mibali/massive-repository$

# In each repository, run this command to modify README files
steps:
  - run: |
      LINE_TO_ADD="Hello World"
      TOTAL=$(find . -name "*.md" | wc -l)
      COUNT=0
      
      find . -name "*.md" | while read file; do
        # Add the line to the end of the file
        echo "$LINE_TO_ADD" >> "$file"
        
        # Increment counter
        COUNT=$((COUNT+1))
        
        # Show progress every 100 files
        if (( COUNT % 100 == 0 )) || (( COUNT == TOTAL )); then
          echo "Processed $COUNT/$TOTAL files..."
        fi
      done
    container: ubuntu:18.04

# Describe the changeset (e.g., GitHub pull request) you want for each repository
changesetTemplate:
  title: Hello World4
  body: My first batch change!!
  branch: hello-world-branch
  commit:
    message: Append Hello World to all README.md files
    author:
      name: Michael B
      email: mb@gmail.com

